create table outs
(
    out_id     int auto_increment
        primary key,
    station_id int          not null,
    outt       varchar(255) not null,
    textt      text         null,
    constraint outt
        unique (outt),
    constraint outs_ibfk_1
        foreign key (station_id) references stations (station_id)
);

create index station_id
    on outs (station_id);

